\setlength{\\baselineskip}{1.5\\baselineskip}\\LARGE\\textbf{% templatetag openbrace %}{{ student.name|texescape }}{% templatetag closebrace %}{% templatetag closebrace %}\r\n\\end{center}\r\n\r\n\\columnbreak\r\n\r\n\\begin{flushleft}\r\n\\nameblock\r\n\\end{flushleft}\r\n\r\n\\end{multicols}\r\n\\begin{center}\r\n{\\large \\textbf{Class Schedule} \\\\}\r\n\r\n\\vspace{0.25cm}\r\n\r\n\r\n{\\textbf Saturday, 12 July \\\\}\r\n\\begin{tabularx}{18cm}{|>{\\hsize=.75\\hsize}X|>{\\hsize=1.25\\hsize}X|p{0.5in}|}\r\n\\hline\r\n\\textbf{Time and Room} & \\textbf{Class and Teacher} & \\textbf{Code} \\\\\r\n\r\n\r\n{% for cls in student.classes %}\\hline\r\n\r\n{% if "Jul 12" in cls.friendly_times %}\r\n\r\n{% if cls.friendly_times|length_is:"0" %}N/A{% endif %}{{ cls.friendly_times|join:", " }}\r\n\r\n\\newline\r\n\r\n\\footnotesize{ {% if cls.initial_rooms|length_is:0 %}N/A{% else %}{{cls.prettyrooms|join:", "|texescape }}{% endif %} }\r\n\r\n&\r\n{% if cls.title|length_is:"0" %}N/A{% endif %} {{ cls.title|truncatewords:6|texescape }}\r\n\r\n\\newline\r\n\r\n\\footnotesize{ {{ cls.parent_class.getTeacherNames|join:", "|texescape }} } \r\n&\r\n\\texttt{ {{ cls.emailcode }} } \\\\\r\n\r\n{% endif %}\r\n\r\n{% endfor %}\\hline\r\n\\end{tabularx}\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\\end{center}\r\n\r\n\\begin{itemize}\r\n\\itemsep-.5em\r\n\\item Questions? Problems? Class changes? Come to our help desk in WLH 113.\r\n\\item If you do not have class during a time slot, please go to the student lounge in WLH 001. Do not wander.\r\n\\item If something makes you uncomfortable or feel unsafe, please report it to administrators, teachers, or other authorities -- be proactive.\r\n\\item Have fun!\r\n\\end{itemize}\r\n\r\n\r\n\\vspace*{\\fill}\r\n\\barcodeblock\r\n\\vspace{1in}\r\n{% if not forloop.last %}\\pagebreak{% endif %}\r\n\r\n\\newpage\r\n{% endfor %}\r\n\r\n\\end{document}\r\n{% endautoescape %}\r\n	4
